RAWALPINDI, Jul 27 (APP):Chief of Air Staff (CAS) Air Chief Marshal Mujahid Anwar Khan on Monday called on Chief of Army Staff (COAS) General Qamar Javed Bajwa at General Headquarters (GHQ).
Both the chiefs, during the meeting, discussed matters of professional interest, said an Inter Services Public Relations (ISPR) press release.
